import React from 'react';
import logo from './Yorkshire-Water-logo.jpg';
import './App.css';
import {Button} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
        <img src={logo} className="logo" alt="logo" width="400" height="200"/>
        <p>
          TEST TEST TEST
        </p>
        <>
  <style type="text/css">
    {`.btn-xxl {
      padding: 2rem 3rem;
      font-size: 2rem;
    }
    `}
  </style>
  <Button variant="outline-primary" size="xxl" className = "central">
    flat button
  </Button>
</>
    </div>
  );
}

export default App;
